  //     console.log(stat);

  //     return <td key={Math.random()}>{stat.duration}</td>;
  //   });
  // });
  // energyDelta = moves.map(el => {
  //   return el.quick_moves.stats.map(stat => {
  //     return <td key={Math.random()}>{stat.energy_delta}</td>;
  //   });
  // });
  // moveCooldown = moves.map(el => {
  //   return el.quick_moves.stats.map(stat => {
  //     return <td key={Math.random()}>{stat.move_cooldown}</td>;
  //   });
  // });

  return (
    <div className={classes.Table}>
      <table>
        <tr>
          <th key={Math.random()} style={{ textAlign: "left" }}>
            Stats
          </th>
          {data.map((el, index) => {
            return <th key={Math.random()}>{el} </th>;
          })}
        </tr>
        <tbody>
          <tr>
            <td key={Math.random()} style={{ textAlign: "left" }}>
              Base Power
            </td>
            {basePower}
          </tr>
          <tr>
            <td key={Math.random()} style={{ textAlign: "left" }}>
              Duration
            </td>
            {duration}
          </tr>
          <tr>
            <td key={Math.random()} style={{ textAlign: "left" }}>
              Energy Delta
            </td>
            {energyDelta}
          </tr>
          <tr>
            <td key={Math.random()} style={{ textAlign: "left" }}>
              Move Cooldown
            </td>
            {moveCooldown}
          </tr>
        </tbody>
      </table>
    </div>
  );
};

export default table;
